"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Myoclonus (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/myoclonus-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H16566963\">",
"      <span class=\"h1\">",
"       What is myoclonus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Myoclonus is the medical term for short, jerking muscle spasms that a person cannot control. When people have myoclonus, their muscles jerk, twitch, spasm, or shake.",
"     </p>",
"     <p>",
"      Myoclonus can affect different parts of the body. It can affect the whole body at once, or just 1 part, such as a leg or foot.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16566978\">",
"      <span class=\"h1\">",
"       What causes myoclonus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Myoclonus can be caused by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A disease that damages the brain and nervous system, such as Parkinson disease",
"       </li>",
"       <li>",
"        An injury or condition that keeps the brain from getting enough oxygen",
"       </li>",
"       <li>",
"        Epilepsy",
"       </li>",
"       <li>",
"        Diseases that affect certain organs or glands in the body &mdash; These include liver failure, kidney failure, and overactive thyroid.",
"       </li>",
"       <li>",
"        A bad reaction to medicines or chemicals",
"       </li>",
"       <li>",
"        A condition called &ldquo;essential myoclonus&rdquo; &mdash; In this condition, myoclonus is the most obvious symptom or the only symptom.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some myoclonus is normal in healthy people. For example, many people have a sudden muscle twitch or jerk when they are falling asleep. Sometimes, the whole body jerks. Movements or twitches that happen during sleep can also be myoclonus. &nbsp; &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16566993\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See a doctor or nurse if you start having muscle spasms or twitches you cannot control.",
"     </p>",
"     <p>",
"      If you have epilepsy and your seizures change or get worse, see your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16567008\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Your doctor or nurse will talk with you and do an exam. He or she will decide which tests you should have based on your age, other symptoms, and situation. There are lots of tests, but you might not need any.",
"     </p>",
"     <p>",
"      The most common tests for myoclonus are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood and urine tests",
"       </li>",
"       <li>",
"        EEG &mdash; This test measures electrical activity in the brain and records brain wave patterns.",
"       </li>",
"       <li>",
"        Brain or spine imaging tests &ndash; These tests create pictures of the inside of the body. These tests include CT scans and MRIs.",
"       </li>",
"       <li>",
"        Lumbar puncture (also called a &ldquo;spinal tap&rdquo;) &mdash; For this test, a doctor puts a thin needle in the lower back and removes a small amount of spinal fluid. Spinal fluid is the fluid around the brain and spinal cord. Another doctor will do lab tests on the spinal fluid.",
"       </li>",
"       <li>",
"        EMG &mdash; This test measures electrical activity in the muscles. It shows whether the muscles are responding the right way to electrical signals.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16567023\">",
"      <span class=\"h1\">",
"       How is myoclonus treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on what is causing the myoclonus. If it is caused by a condition doctors can cure, such as a disease or tumor, doctors will treat that condition. This can make myoclonus get better or go away.",
"     </p>",
"     <p>",
"      But myoclonus is often caused by conditions that doctors cannot cure. This can make it very hard or impossible to get rid of myoclonus.",
"     </p>",
"     <p>",
"      Doctors can try different treatments. These help some people feel better. In general, these treatments work by blocking or calming the nerve signals that make the muscles jerk or twitch. Treatments include medicines normally used to control seizures and shots of a medicine called botulinum toxin (brand name: Botox&reg;).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16567038\">",
"      <span class=\"h1\">",
"       What if my child gets myoclonus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your baby or child starts having muscle twitches or spasms, take him or her to see a doctor or nurse. If your child has epilepsy and the seizures get worse or change, talk to his or her doctor.",
"     </p>",
"     <p>",
"      Some children get a type of myoclonus that can run in families. It is not usually serious. Children with this condition just have myoclonus, not another problem that is causing myoclonus. For them, the muscle jerks and spasms usually start around age 4 to 8, but the symptoms can start later. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16567053\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
