var title_f2_44_2764="Initial rx dyslipidemia HIV";
var content_f2_44_2764=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F62891&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F62891&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for choice of initial drug therapy for dyslipidemia in HIV-infected individuals receiving antiretroviral therapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Lipid abnormality",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Therapy",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Comments, rating",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        First choice, rating",
"       </td>",
"       <td class=\"subtitle2\">",
"        Alternative(s), rating",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated LDL-C level or elevated non-HDL-C level with triglyceride level of 200-500 mg/dL",
"       </td>",
"       <td>",
"        Statin (B-I)",
"       </td>",
"       <td>",
"        Fibrate (C-I) or niacin (C-III)",
"       </td>",
"       <td>",
"        Start with low doses of statins and titrate upward; with CYP3A4 inhibitors (PIs or delavirdine), pravastatin, 20-40 mg once a day (A-I), or atorvastatin, 10 mg once a day (B-II), initial dose is recommended; fluvastatin, 20-40 mg once a day, is an alternative (B-II); fibrate may elevate the LDL-C level when the triglyceride level is elevated; niacin may worsen insulin resistance; combining fibrate and statin increases the risk of rhabdomyolysis (use with caution and monitor for clinical evidence of myopathy).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Triglyceride level, &gt;500 mg/dL",
"       </td>",
"       <td>",
"        Fibrate (B-I)",
"       </td>",
"       <td>",
"        Niacin (C-III) or fish oils (C-III)",
"       </td>",
"       <td>",
"        Reduction of triglyceride level becomes a primary target in these individuals; drug interactions with fibrates are unlikely; Gemfibrozil dosage is 600 mg twice a day, and fenofibrate dosage is 54-160 mg once a day; niacin may worsen insulin resistance.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     HDL-C: high-density lipoprotein cholesterol; LDL-C: low-density lipoprotein cholesterol; PI: protease inhibitor.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Dube, MP, Stein, JH, Aberg, JA, et al. Guidelines for the evaluation and management of dyslipidemia in HIV-infected adults receiving antiretroviral therapy: recommendations of the HIV medicine association of the infectious diseases society of america and the adults AIDS clinical trials group. Clin Infect Dis 2003; 37:613. Copyright &copy;2003 University of Chicago.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
