var title_f2_44_2765="Lab tests for pertussis";
var content_f2_44_2765=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F78189&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F78189&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Comparison of laboratory tests for the detection of Bordetella pertussis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Laboratory method",
"      </td>",
"      <td class=\"subtitle1\">",
"       Reported sensitivity*",
"      </td>",
"      <td class=\"subtitle1\">",
"       Reported specificity*",
"      </td>",
"      <td class=\"subtitle1\">",
"       Comments",
"      </td>",
"      <td class=\"subtitle1\">",
"       Citations",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Culture of nasopharyngeal secretions",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       15-80 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       100 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Traditional \"gold standard\" for diagnosis; sensitivity decreased in adults, previously vaccinated, previous antibiotic treatment, and longer duration of illness; antibiotic susceptibility testing and strain serotyping possible; readily available in most laboratories",
"      </td>",
"      <td>",
"       Strebel et al, 2001",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Muller et al, 1997",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Loeffelholz et al, 1999",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lind-Brandberg et al, 1998",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Kerr et al, 2000",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Polymerase chain reaction of nasopharyngeal secretions&bull;",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       61-94 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       88-98 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Relatively rapid and more sensitive than culture; better results in populations with reduced yield by culture; no standard methodology; not widely available",
"      </td>",
"      <td>",
"       Strebel et al, 2001",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Muller et al, 1997",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Loeffelholz et al, 1999",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Heininger et al, 2000",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lind-Brandberg et al, 1998",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Direct fluorescent antibody testing of nasopharyngeal secretions&Delta;",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       52-65 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       15-99 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Rapid; requires trained technician; lacks sensitivity and specificity; should not be used as a replacement for culture; not recognized by CDC for confirmation of diagnosis",
"      </td>",
"      <td>",
"       Muller et al, 1997",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Loeffelholz et al, 1999",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ewanowich et al, 1993",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       McNicol et al, 1995",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Kerr et al, 2000",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"4\">",
"       Serology (ELISA) blood",
"      </td>",
"      <td colspan=\"1\" rowspan=\"4\">",
"       60-95 percent",
"      </td>",
"      <td colspan=\"1\" rowspan=\"4\">",
"       &loz;",
"      </td>",
"      <td colspan=\"1\" rowspan=\"4\">",
"       Most useful in epidemiologic studies or vaccine trials; a single high antibody titer suggestive of infection; long turnaround time; not recognized by CDC for confirmation of diagnosis",
"      </td>",
"      <td>",
"       Guris et al, 1999",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Muller et al, 1997",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Heininger et al, 2000",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Kosters et al, 2000",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Reported sensitivities and specificities taken from clinical or epidemiologic studies, or vaccine trials.",
"     <br>",
"      &bull; Compared with clinical case definitions + serology in most studies.",
"      <br>",
"       &Delta; Compared with B. pertussis culture in most studies.",
"       <br>",
"        &loz; Not readily available from epidemiologic studies. An investigation in German adults found a specificity of 84 percent using a clinician's clinical diagnosis as a gold standard [Schmitt-Grohe et al, 1995].",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
